import React from "react";
import Test from "./Test";

function Header({ title }) {
  return (
    <div>
      <h4>{title} </h4>
    </div>
  );
}

function Image({ name, title, src }) {
  return (
    <div className="text-center">
      <img
        src={src}
        alt="avatar mx-auto white"
        className="rounded-circle img-fluid"
      />
      <br />
      <br />
      <h5>{name}</h5>
      <h6>{title}</h6>
    </div>
  );
}

function StaticTrainingPage() {
  return (
    <div>
      <Header title="Leadership" />
      <div className="row">
        <div className="col">
          <Image
            name="Kristin"
            title="Project Manager"
            src="https://mdbootstrap.com/img/Photos/Avatars/img%20(27).jpg"
          />
        </div>
        <div className="col">
          <Image
            name="Kristin"
            title="Project Manager"
            src="https://mdbootstrap.com/img/Photos/Avatars/img%20(27).jpg"
          />
        </div>
        <div className="col">
          <Image
            name="Kristin"
            title="Project Manager"
            src="https://mdbootstrap.com/img/Photos/Avatars/img%20(27).jpg"
          />
        </div>
        <div className="col">
          <Image
            name="Kristin"
            title="Project Manager"
            src="https://mdbootstrap.com/img/Photos/Avatars/img%20(27).jpg"
          />
        </div>
      </div>
      <Header title="Scaled Agile 5.0" />
      <div className="row"></div>
      <Header title="Scrum.org" />
      <div className="row"></div>
      <Header title="Scrum Alliance" />
      <div className="row"></div>
      <Header title="PMI" />
      <div className="row"></div>
      <Header title="Corporate Training" />
      <div className="row"></div>
    </div>
  );
}
class TrainingPage extends React.Component {
  render() {
    return (
      <div className="container">
        <StaticTrainingPage />

        <br />
        <br />
      </div>
    );
  }
}
export default TrainingPage;
